    , bankAccountAccountHolderName :: Maybe (Text)
    {- ^ The name of the person or business that owns the bank account. -}
    , bankAccountBankName :: Maybe (Text)
    {- ^ Name of the bank associated with the routing number (e.g., `WELLS FARGO`). -}
